SELECT first_name AS 'First Name', last_name AS 'Last Name', course_code AS 'Course', section AS 'Section #' 
FROM User U, Courses C, Groups G, Group_member M, Student S
WHERE G.group_id = 2 AND G.group_id = M.group_id and C.course_id = G.course_id and M.student_id = S.student_id and U.user_id = S.user_id;
